import React from 'react'

function SavedItem(){
    return (
        <div>
            <div className="container">
            <img src={props.imageLinks} />
            <h4>{props.title}</h4>
            <h5>{props.authors}</h5>
            <h6>{props.categories}</h6><hr />
            <p>{props.description}</p>
        </div>
        </div>
    )
}

export default SavedItem;
